import React from 'react';
import { SideBarContainer } from './SideBarStyles.elements';
import SideBarMenuItem from './SideBarMenuButton';

const SideBar = () => {
  return (
    <SideBarContainer>
      <SideBarMenuItem></SideBarMenuItem>
    </SideBarContainer>
  );
};

export default SideBar;
